import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonCard, IonCardHeader, IonCardContent, IonCardTitle, IonCardSubtitle, IonImg } from '@ionic/react';
import './About.css';
import Navbar from "../components/Navbar";

const About: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <Navbar />
      </IonHeader>
      <IonContent>
        <div className="flex-center"></div>
        <IonCard>
            <IonCardTitle>About Me</IonCardTitle>
            <img src="assets/Shaun.jpg" alt="" className="card-image"/>
            <IonCardHeader>
                <IonCardSubtitle>Name</IonCardSubtitle>
                <IonCardHeader>Shaun Jennings</IonCardHeader>
            </IonCardHeader>
            <IonCardSubtitle>Description</IonCardSubtitle>
            <IonCardContent>
               I am a 21 year old Computer Science major with a keen interest in Data Science and Business Intellegence. My hobbies include playing games, making games, watching movies and weightlifting.
            </IonCardContent>
        </IonCard>

      </IonContent>
    </IonPage>
  );
};

export default About;
